import React from 'react';
import { motion } from 'framer-motion';

const Education = () => {
  return (
    <motion.section
      id="education"
      className="text-white px-8 py-16"
      initial={{ opacity: 0, y: 50 }}
      whileInView={{ opacity: 1, y: 0 }}
      transition={{ duration: 0.8 }}
      viewport={{ once: true }}
    >
      <h2 className="text-3xl font-bold text-primary mb-4">Education</h2>
      <ul className="space-y-4 text-gray-300">
        <li><strong>B.Tech (CSE)</strong> - 3rd Year (CGPA: 8.53)</li>
        <li><strong>Intermediate</strong> - Sri Chaitanya Junior College (74.5%)</li>
        <li><strong>10th</strong> - Sri Chaitanya Techno School (100%)</li>
      </ul>
    </motion.section>
  );
};

export default Education;
